import React from "react";
import style from "./InputFood.module.css";

const InputFood = ({ label, input }) => {
  return (
    <div className={style.input}>
      <label htmlFor={input.id}>{label}</label>
      <input {...input} />
    </div>
  );
};

export default InputFood;
